import React from 'react';
import AddressComponents from './AddressComponents';


const App = () => {
  let address = {
    name   : 'Express Scripts',
    address: '100 Forest Lane',
    city   : 'Franklin Lakes',
    state  : 'NJ',
    zip    : '07027'
  };

  return (
    <section>
      <AddressComponents today="Monday"/>
      <h1>Hello, world!</h1>

    </section>
  );
};

export default App;
